import Icon from "../../../components/Icon/Icon";
import { GlobalThemes } from "../../../ThemeManager";
import SalesBackground from "../../../assets/SalesBackground.svg";

import "./SalesTheme.scss";
const SalesTheme = ({}: {}) => {
  return (
    <>
      <div className={"salesContainer " + GlobalThemes.Sales}>
        <div className="header">
          <Icon icon="SalesBackground" viewBox="0 0 500 200" />
          <div className="headline one">Sales Theme</div>
        </div>
      </div>
    </>
  );
};
export default SalesTheme;
